import React from 'react';
import styles from '../styles/ToursPage.module.css';

function ToursPage() {
    return (
        <div className={styles.pageContainer}>
            <header className={styles.hero}>
                <h1>Our Tours</h1>
                <p>Curated tours for an unforgettable experience.</p>
            </header>
            <section className={styles.tourList}>
                <div className={styles.tour}>
                    <h2>Safari Adventure</h2>
                    <p>Experience wildlife up close in Africa.</p>
                </div>
                <div className={styles.tour}>
                    <h2>European Getaway</h2>
                    <p>Explore the historic landmarks of Europe.</p>
                </div>
            </section>
        </div>
    );
}

export default ToursPage;
